    methods ( Static )
        
        function cdata = getIcon( icoName, icoColor, bgColor )
            
            % Make sure icoColor values are between 0 and 1
            if max( icoColor(:) ) > 1
                icoColor = double( icoColor ) / 255;
            end
            
            % Make sure bgColor values are between 0 and 1
            if max( bgColor(:) ) > 1
                bgColor = double( bgColor ) / 255;
            end
            
            % Get the alpha map of the icon
            alpha = Icons.( lower( icoName ) );
            
            % Create background true color matrix
            bg = bsxfun( @times, reshape( bgColor, [ 1 1 3 ] ), ones( size( alpha ) ) );
            
            % Create icon color true color matrix
            cdata = bsxfun( @times, reshape( icoColor, [ 1 1 3 ] ), ones( size( alpha ) ) );
            
            % Compute alpha channel of each of the true color channels
            alphaChan = bsxfun( @times, ones( 1, 1, 3 ), 1 - double( alpha ) / 255 );
            
            % Compute icon cdata by combining background and foreground colors according to alpha map
            cdata = alphaChan .* bg + ( 1 - alphaChan ) .* cdata;

        end
        
        function icoList = getAvailableIconIds( )
            metadata = meta.class.fromName( mfilename );
            icoList = { metadata.PropertyList.Name };
        end
        
    end
    
